pub enum XmlError {
    Parser {
        e: quick_xml::Error,
    },
    Url {
        e: url::ParseError,
    },
}

pub enum ParseFeedError {
    ParseError(ParseErrorKind),
    IoError(std::io::Error),
    JsonSerde(serde_json::error::Error),
    XmlReader(xml::XmlError),
}

pub enum ParseErrorKind {
    NoFeedRoot,
    UnknownMimeType(String),
    MissingContent(&'static str),
}
